geregisseerd door Chris Kentis en Laura Lau
met Elizabeth Olsen, Eric Sheffer Stevens en Julia Taylor Ross

Sarah (Elizabeth Olsen) is een jonge vrouw die een traumatische jeugd had. Terwijl ze samen met haar vader en haar oom naar het afgelegen zomerhuis van de familie gaat, komen ze er achter dat ze er niet alleen zijn. Ze horen een geluid wat schijnbaar van boven komt. De dan volgende angstaanjagende tachtig minuten worden verteld vanuit Sarah's oogpunt.



